import React from "react";
import { motion } from "framer-motion";

export default function Navbar() {
  return (
    <motion.nav
      className="bg-blue-700 text-white px-6 py-4 shadow-md flex justify-between items-center"
      initial={{ y: -60, opacity: 0 }}
      animate={{ y: 0, opacity: 1 }}
      transition={{ duration: 0.5 }}
    >
      <div className="text-xl font-bold">PRS Technology Software and Services</div>
      <div className="space-x-4 text-sm md:text-base">
        <a href="/" className="hover:text-yellow-300 transition-all duration-300">
          Home
        </a>
        <a href="/contact" className="hover:text-yellow-300 transition-all duration-300">
          Contact
        </a>
      </div>
    </motion.nav>
  );
}
